INSERT INTO `games` VALUES (1,'ett_liv','Hr har du ett liv','img/ettliv.png','Kryptisk beskrivning av ett djur.<br />Det gller att identifiera det djur det handlar om.','Tvlingen gick, tillsammans med tvlingen \"Snl information om person\", under namnet \"Snlskjutsen\" som sommartvling i Sydsvenskan 1981. Man tvlade om 10 resor till Skottland fr tv personer.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 14 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(2,'person','Snl information om person',NULL,'Den givna informationen leder till en knd person - som kan vara en nu levande person, en historisk sdan men ocks en figur frn sago- eller seriesammanhang.','Tvlingen gick, tillsammans med tvlingen \"Hr har du ett liv\", under namnet \"Snlskjutsen\" som sommartvling i Sydsvenskan 1981. Man tvlade om 10 resor till Skottland fr tv personer. Tnk p att vissa av personerna var aktuella runt 1981 och inte r lika knda idag.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 14 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(3,'dubbelnoten','Dubbelnten',NULL,'Det gller dels att lura ut namnet p en viss svensk ort, dels att bestmma en vxt. I uppgiften stlls ni infr en \"omformulerad ort\" och en \"kryptisk fanerogam\". Orten och vxten har fr vrigt en gemensam nmnare: vxten r karakteristisk fr det landskap dr orten ligger och r i flertalet fall s.k. landskapsblomma.','Tvlingen gick som sommartvling i Sydsvenskan 1982. Man tvlade om 20 resor till Berlin fr tv personer.','Skriv dina svar i rutorna. Nr du skrivit rtt svar p bde ort och vxt fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(4,'fragvisan','Frgvisan',NULL,'Hr testas dina kunskaper kring visor, snger, kupletter, operetter osv. - i samtliga fall gamla plitliga rhngen. Identifiera en sng, en visa eller vad det kan vara, med hjlp av en kryptisk beskrivning som syftar p titeln eller innehllet.','Tvlingen gick som sommartvling i Sydsvenskan 1983. Man tvlade om 20 resor till Paris fr tv personer.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(5,'sommarcharaden','Sommarcharaden',NULL,'Att lsa charader r en gammal lek som gr ut p att finna fram till ett ord med hjlp av rimmande hntydningar.<br />vningsexempel:<br />Mitt frsta r husets hgsta parti.<br />Mitt andra med matte kopplat kan bli.<br />Mitt hela kan klaras med strategi.<br />Svar:Taktik','Tvlingen gick som sommartvling i Sydsvenskan 1990. Man tvlade om 10 midjevskor och 10 uppblsbara nackstd.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(6,'dubbelordet','Dubbelordet',NULL,'Det gller att med hjlp av ledtrdar finna ett ord som har tv betydelser. Exempel:<br />Sdan blick man kanske ser<br />eller<br />Ngonting som finns lngst ner<br />Svar: Trad','Tvlingen gick som sommartvling i Sydsvenskan 1991. I varje uppgift tvlade man om 1 axelremsvska, 5 sommarparaplyer och 5 picknickmuggar.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 36 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(7,'ordvandningen','Ordvndningen',NULL,'Hr sks ett ord som nr det lses baklnges blir ett annat ord (t.ex. t-t). En ledtrd i vardera riktningen ges.','Tvlingen gick som sommartvling i Sydsvenskan 1992. I prispotten fanns seglarsckar, shoppingkassar, strandkuddar, handledsbrsar och nyckelringar.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 36 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(8,'ordleken','Ordleken',NULL,'Uppgiften i Ordleken r att identifiera ett antal rtt vanliga svenska ordsprk bakom lika mnga snriga formuleringar.','Tvlingen gick som sommartvling i Sydsvenskan 1984 och tjugo Norgeresor lg i vinstpotten.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(9,'sommarsagan','Sommarsagan',NULL,'Hr ska du lura ut vilka sagor eller sagofigurer jag syftar p i mer eller mindre mystiska rubriker. ','Tvlingen gick som sommartvling i Sydsvenskan 1985 och tjugo Londonresor stod p spel.','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL),(10,'kandisjakten','Kndisjakten',NULL,'I Kndisjakten gller det att lura ut vilka vlknda personer &mdash; nu levande, historiska eller uppdiktade &mdash; som dljer sig bakom ett antal kryptiska, kortfattade beskrivningar.<br />Tnk p att formuleringarna skrevs 1986 och vissa kndisar (eller beskrivningar av dem) som var aktuella d kanske inte r det idag.','Tvlingen gick som sommartvling i Sydsvenskan 1986 och i vinstpotten fanns bland annat tio resor fr tv personer till Moseldalen. ','Skriv ditt svar i rutan. Nr du skriver rtt svar fr du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtrd s frga mig grna eller skriv ett inlgg p<br />Bertils klurigheter.',NULL,NULL);
